// src/components/ThoughtTree.js
import React from 'react';
import { motion } from 'framer-motion';
import './ThoughtTree.css';

const ThoughtTree = ({ thoughts, selectThought }) => {
  return (
    <div className="thought-tree">
      {thoughts.map((thought, index) => (
        <motion.div
          key={thought.id}
          className="thought-node"
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ delay: index * 0.2 }}
          onClick={() => selectThought(thought)}
        >
          <img src={thought.image} alt={thought.title} />
        </motion.div>
      ))}
    </div>
  );
};

export default ThoughtTree;
